import { HeaderWrapper, Logo, Nav, NavItem } from './style';

function Header() {
    return (
        <HeaderWrapper>
            <Logo />
            <Nav>
                <NavItem>首页</NavItem>
                <NavItem>下载App</NavItem>
                <NavItem>登录</NavItem>
                <NavItem>Aa</NavItem>
            </Nav>
        </HeaderWrapper>
    );
}

export default Header;
